import "./App.css";
import denverpic from "./assets/img/DenverJam_poster.png";
import Marquee from "react-fast-marquee";
import { fontSize } from "@mui/system";

function App() {
  return (
    <div className="App">
      <div className="headercontainer">
        <img
          alt="Denver Open Jam - Come Play With Local Musicians"
          className="mainpic"
          src={denverpic}
        ></img>
        <div>
        <Marquee pauseOnHover="true" speed="30" gradient="">
          <span className="scrolltext"> Hello </span>
        </Marquee></div>
      </div>
      <div className="maincontainer">
        <div className="contentcontainer"></div>
      </div>
    </div>
  );
}

export default App;
